sap.ui.controller("application.viewWorkOrder",{onInit:function(){viewWorkOrderController=this;this.getView().addEventDelegate({onBeforeShow:function(a){viewWorkOrderController.onBeforeShow(a.data)}})},onBackPress:function(){workOrderApp.getNavigation().backPage()},onBeforeShow:function(a){console.log(a);if(a.action==="viewExisting"){var b=new sap.ui.model.json.JSONModel(a.workOrder);sap.ui.getCore().setModel(b,"currentWorkOrder")}else{if(a.action==="readNew"){oResponse={statusCode:200,data:referenceData.workOrders[a.workOrderNumber]};viewWorkOrderController.onReadNewWorkOrderCallback(oResponse)}}},onReadNewWorkOrderCallback:function(b){if(b===undefined||b===null||b.statusCode!==200||b.data===undefined||b.data===null){return}var d=sap.ui.getCore().getModel("workOrderList").getData();d.data.push(b.data);var a=new sap.ui.model.json.JSONModel(d);sap.ui.getCore().setModel(a,"workOrderList");var c=new sap.ui.model.json.JSONModel(b.data);sap.ui.getCore().setModel(c,"currentWorkOrder")}});